import React, { useState, useEffect } from "react";
import { Navbar } from "../index";
import "./Pickup.css";

function Pickup() {
  const [formData, setFormData] = useState({
    parcel: "0",
    pickupDate: "",
    pickupTime: "0",
    pickupLocation: "",
    province: "0",
  });

  const [parcelOptions, setParcelOptions] = useState([]); // State to store parcel options

  useEffect(() => {
    // Fetch parcel data when the component mounts
    fetch("/pickup")
      .then((response) => {
        if (response.ok) {
          return response.json();
        }
        throw new Error("Failed to fetch parcel data");
      })
      .then((data) => {
        // Assuming data is an array of parcel objects with id and name properties
        setParcelOptions(data.parcel_ID);
      })
      .catch((error) => {
        console.error("Error fetching parcel data:", error);
      });
  }, []); // Empty dependency array ensures this effect runs only once, on mount

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Send form data to backend
    fetch("/your-backend-api-endpoint", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    })
      .then((response) => {
        if (response.ok) {
          console.log("Data submitted successfully");
          setFormData({
            parcel: "0",
            pickupDate: "",
            pickupTime: "0",
            pickupLocation: "",
            province: "0",
          });
        } else {
          console.error("Failed to submit data");
        }
      })
      .catch((error) => {
        console.error("Error occurred:", error);
      });
  };

  return (
    <div>
      <Navbar />
      <div className="Pickup-container" id="container">
        <div className="Pickup-form-container">
          <form onSubmit={handleSubmit}>
            <h1 className="header">Pickup request</h1>
            <span>select location and date for pickup service</span>
            <br />
            <br />

            {/* Parcel selection */}
            <div className="form-group row">
              <label className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Select parcel</span>
              </label>
              <div className="enterdata">
                <select
                  name="parcel"
                  value={formData.parcel}
                  onChange={handleInputChange}
                >
                  {/* Populate options from state */}
                  {parcelOptions.map((parcel, index) => (
                    <option key={index} value={parcelOption}>
                      {parcelOption.parcel_ID}
                    </option>
                  ))}
                </select>
              </div>
            </div>
            {/* Pickup date */}
            <div className="form-group row">
              <label className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Pickup date</span>
              </label>
              <div className="enterdata">
                <input
                  type="date"
                  name="pickupDate"
                  value={formData.pickupDate}
                  onChange={handleInputChange}
                />
              </div>
            </div>
            {/* Pickup time */}
            <div className="form-group row">
              <label className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Pickup time</span>
              </label>
              <div className="enterdata">
                <select
                  name="pickupTime"
                  value={formData.pickupTime}
                  onChange={handleInputChange}
                >
                  <option value="0">10:00 - 13:00</option>
                  <option value="1">13:00 - 15:00</option>
                  <option value="2">15:00 - 17:00</option>
                </select>
              </div>
            </div>
            {/* Pickup location detail */}
            <div className="form-group row">
              <label className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Pickup location detail</span>
              </label>
              <div className="enterdata">
                <input
                  type="text"
                  name="pickupLocation"
                  value={formData.pickupLocation}
                  onChange={handleInputChange}
                  placeholder="Enter address details"
                />
              </div>
            </div>
            {/* Provinces/District/Sub-district/zip code */}
            <div className="form-group row">
              <label className="col-sm-4 col-form-label">
                <span className="lb_IDCard">
                  Provinces/District/Sub-district/zip code
                </span>
              </label>
              <div className="enterdata">
                <select
                  name="province"
                  value={formData.province}
                  onChange={handleInputChange}
                >
                  <option value="0">BKK</option>
                  <option value="1">Samut prakarn</option>
                </select>
              </div>
            </div>
            <br />
            {/* Submit Button */}
            <button type="submit">Submit</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Pickup;
